    "Start of transcript. Skip to the end.": "\u0628\u062f\u0627\u064a\u0629 \u0627\u0644\u0646\u0635. \u062a\u062e\u0637 \u0625\u0644\u0649 \u0627\u0644\u0646\u0647\u0627\u064a\u0629.", 
