    "Student Visibility": "\u0642\u0627\u0628\u0644\u064a\u0629 \u0627\u0644\u0631\u0624\u064a\u0629 \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0644\u0637\u0644\u0651\u0627\u0628", 
