    "The email address you use to sign in. Communications from {platform_name} and your courses are sent to this address.": "\u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0627\u0644\u0630\u064a \u062a\u0633\u062a\u062e\u062f\u0645\u0647 \u0644\u062a\u0633\u062c\u064a\u0644 \u062f\u062e\u0648\u0644\u0643. \u062a\u064f\u0631\u0633\u064e\u0644 \u062c\u0645\u064a\u0639 \u0627\u0644\u0645\u0631\u0627\u0633\u0644\u0627\u062a \u0645\u0646 {platform_name} \u0648\u0645\u0633\u0627\u0642\u0627\u062a\u0643 \u0625\u0644\u0649 \u0647\u0630\u0627 \u0627\u0644\u0639\u0646\u0648\u0627\u0646.", 
