      "\u064a\u0648\u062c\u062f %(count)s \u0625\u0628\u0644\u0627\u063a \u0639\u0644\u0649 \u0647\u0630\u0647 \u0627\u0644\u0645\u0644\u0627\u062d\u0638\u0627\u062a \u0627\u0644\u062a\u0648\u0636\u064a\u062d\u064a\u0629", 
