    "Your upload of '{file}' failed.": "\u0639\u0630\u0631\u064b\u0627\u060c \u0641\u0634\u0644 \u062a\u062d\u0645\u064a\u0644\u0643 \u0644\u0645\u0644\u0641 '{file}'. ", 
